import React from 'react';

function About() {
  return (
    <section id="about" className="py-16 px-6 bg-gray-100">
      <div className="max-w-5xl mx-auto text-center">
        <h2 className="text-3xl font-bold mb-4">About Us</h2>
        <p>We are a team of passionate wedding planners helping couples create the wedding of their dreams. From concept to execution, we ensure every detail is perfect.</p>
      </div>
    </section>
  );
}

export default About;
